import React from 'react';
import PropTypes from 'prop-types';
import { makeStyles } from '@material-ui/core/styles';
import AppBar from '@material-ui/core/AppBar';
import Tabs from '@material-ui/core/Tabs';
import Tab from '@material-ui/core/Tab';
import Typography from '@material-ui/core/Typography';
import Box from '@material-ui/core/Box';
import moment from 'moment';

function TabPanel(props) {
  const { children, value, index, ...other } = props;

  return (
    <Typography
      component="div"
      role="tabpanel"
      hidden={value !== index}
      id={`wrapped-tabpanel-${index}`}
      aria-labelledby={`wrapped-tab-${index}`}
      {...other}
    >
      {value === index && <Box p={3}>{children}</Box>}
    </Typography>
  );
}

TabPanel.propTypes = {
  children: PropTypes.node,
  index: PropTypes.any.isRequired,
  value: PropTypes.any.isRequired,
};

function a11yProps(index) {
  return {
    id: `wrapped-tab-${index}`,
    'aria-controls': `wrapped-tabpanel-${index}`,
  };
}

const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
    backgroundColor: theme.palette.background.paper,
  },
}));

export default function TabsWrappedLabel() {
  const classes = useStyles();
  const [value, setValue] = React.useState('one');
  const time = moment().format('L');  

  const handleChange = (event, newValue) => {
    setValue(newValue);
  };

  return (
    <div className={classes.root}>
      <AppBar position="static">
        <Tabs value={value} onChange={handleChange} aria-label="wrapped label tabs example">
          <Tab value="one" label="Lundi" {...a11yProps('one')} />
          <Tab value="two" label="Mardi" {...a11yProps('two')} />
          <Tab value="three" label="Mercredi" {...a11yProps('three')} />
          <Tab value="four" label="Jeudi" {...a11yProps('four')} />
          <Tab value="five" label="Vendredi" {...a11yProps('five')} />
          <Tab value="six" label="Samedi" {...a11yProps('four')} />
          <Tab value="seven" label={time} {...a11yProps('five')} />
        </Tabs>
      </AppBar>
      <TabPanel value={value} index="one">

      </TabPanel>
      <TabPanel value={value} index="two">
        Item Two
      </TabPanel>
      <TabPanel value={value} index="three">
        Item Three
      </TabPanel>
      <TabPanel value={value} index="four">
        Item One
      </TabPanel>
      <TabPanel value={value} index="five">
        Item Two
      </TabPanel>
      <TabPanel value={value} index="six">
        Item Three
      </TabPanel>
      <TabPanel value={value} index="seven">
        Item Three
      </TabPanel>

    </div>
  );
}
